package ua.models; public class Movie implements Comparable<Movie>{ private int id; private String title; private int year; public Movie(int id,String title,int year){this.id=id;this.title=title;this.year=year;} public int getId(){return id;} public String getTitle(){return title;} public int getYear(){return year;} public int compareTo(Movie o){return Integer.compare(id,o.id);} }